// 记录所有参与者地址\\r\\n    address[] private _memberList;\\r\\n\\r\\n    // 分期释放信息结构\\r\\n    struct TokenVestingInfo {\\r\\n        address beneficiaryToken;\\r\\n        uint256 tokenTotalAmount;\\r\\n        address[] vestingAddress;\\r\\n    }\\r\\n\\r\\n    // 通过受益人Token查分期释放信息\\r\\n    mapping(address => TokenVestingInfo) public tokenVestingList;\\r\\n\\r\\n    constructor(\\r\\n        IERC20 _purchaseToken,   // 用于众筹的代币地址\\r\\n        uint256 _rate,           // 兑换比例\\r\\n        address payable _wallet, // 接收ETH受益人地址\\r\\n        IERC20 _token,           // 代币地址\\r\\n        address _tokenWallet     // 代币从这个地址发送\\r\\n    ) CrowdsaleUnlimited(_rate, _wallet, _token) {\\r\\n        require(address(_purchaseToken) != address(0), \\"CrowdsaleForRetailUnlimited: purchase token is the zero address\\");\\r\\n\\r\\n        purchaseToken = _purchaseToken;\\r\\n        tokenWallet = _tokenWallet;\\r\\n    }\\r\\n\\r\\n    /**\\r\\n     * @dev get _memberList\\r\\n     */\\r\\n    function getMemberList() public onlyOwner view returns (address[] memory) {\\r\\n        return _memberList;\\r\\n    }\\r\\n\\r\\n    /**\\r\\n     * @dev Checks the amount of tokens left in the allowance.\\r\\n     * @return Amount of tokens left in the allowance\\r\\n     */\\r\\n    function remainingTokens() public view returns (uint256) {\\r\\n        return Math.min(token.balanceOf(tokenWallet), token.allowance(tokenWallet, address(this)));\\r\\n    }\\r\\n\\r\\n    /**\\r\\n     * @dev get vestingAddress list from the tokenVestingList\\r\\n     */\\r\\n    function getTokenVestingAddressByAccount(address account) public view returns (address[] memory) {\\r\\n        TokenVestingInfo storage info = tokenVestingList[account];\\r\\n        return info.vestingAddress;\\r\\n    }\\r\\n\\r\\n    // 重写预先验证方法\\r\\n    // 校验金额\\r\\n    function _preValidatePurchase(address beneficiary, uint256 weiAmount) internal override view {\\r\\n        super._preValidatePurchase(beneficiary, weiAmount);\\r\\n    }\\r\\n\\r\\n    // 修改变量状态\\r\\n    function _updatePurchasingState(address beneficiary, uint256 weiAmount) internal override {\\r\\n        super._updatePurchasingState(beneficiary, weiAmount);\\r\\n        // 接收众筹DAT\\r\\n        purchaseToken.safeTransferFrom(beneficiary, wallet, weiAmount);\\r\\n    }\\r\\n\\r\\n    // 执行众筹\\r\\n    function _deliverTokens(address beneficiary, uint256 tokenAmount) internal override {\\r\\n        address vestingToken = address(new TokenVestingRetailUnlimited(\\r\\n            beneficiary, // 受益人地址\\r\\n            block.timestamp, // 当前众筹时间\\r\\n            tokenAmount // 质押数量\\r\\n        ));\\r\\n        TokenVestingInfo storage info = tokenVestingList[beneficiary];\\r\\n        if (info.beneficiaryToken != address(0)) {\\r\\n            info.tokenTotalAmount = info.tokenTotalAmount.add(tokenAmount);\\r\\n            info.vestingAddress.push(vestingToken);\\r\\n        } else {\\r\\n            tokenVestingList[beneficiary] = TokenVestingInfo({\\r\\n                beneficiaryToken: beneficiary,\\r\\n                tokenTotalAmount: tokenAmount,\\r\\n                vestingAddress: new address[](0)\\r\\n            });\\r\\n            tokenVestingList[beneficiary].vestingAddress.push(vestingToken);\\r\\n            // 记录beneficiary地址\\r\\n            _memberList.push(beneficiary);\\r\\n        }\\r\\n        // 代币转入分期释放合约地址\\r\\n        token.safeTransferFrom(tokenWallet, vestingToken, tokenAmount);\\r\\n    }\\r\\n}\\r\\n","sourcePath":"D:\\\\Workspaces\\\\DaoswapDex\\\\daoswapdex\\\\core-crowdsale2\\\\contracts\\\\CrowdsaleForRetailUnlimited.sol","ast":{"absolutePath":"project:/contracts/CrowdsaleForRetailUnlimited.sol","exportedSymbols":{"Address":[742],"Context":[764],"CrowdsaleForRetailUnlimited":[2048],"CrowdsaleUnlimited":[1423],"IERC20":[221],"Math":[852],"Ownable":[103],"ReentrancyGuard":[143],"SafeERC20":[445],"SafeMath":[1164],"TokenVestingRetailUnlimited":[1775]},"id":2049,"license":"MIT","nodeType":"SourceU